import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";
import Navbar from "./components/Navbar";
import SelectRole from "./pages/SelectRole";
import SignIn from "./pages/SignIn";
import PatientDashboard from "./pages/PatientDashboard";

function App() {
  const [role, setRole] = useState(null);
  const [user, setUser] = useState(null);

  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/select-role" element={<SelectRole setRole={setRole} />} />
        <Route
          path="/signin"
          element={role ? <SignIn role={role} setUser={setUser} /> : <Navigate to="/select-role" />}
        />
        <Route
          path="/patient/dashboard"
          element={user ? <PatientDashboard user={user} /> : <Navigate to="/signin" />}
        />
        <Route path="*" element={<Navigate to="/select-role" />} />
      </Routes>
    </Router>
  );
}

export default App;
